<pre><code>&lt;h1&gt;User List&lt;/h1&gt;
    &lt;ul&gt;
      &lt;%
        var list = '';
        for (i = 0; i &lt; userlist.length; i++) {
          if (userlist[i].deleted==false) {
            list += `&lt;li&gt;&lt;a href=&quot;userdetail/?uid=&quot;+${userlist[i].uid}&quot; id=&quot;${i}&quot;&gt; ${userlist[i].username} &lt;/a&gt;&lt;/li&gt;`;
          }
        }
      %&gt;
      &lt;%- list %&gt;
