Is there a better way to adding a field based on the result of aggregation in MongoDB<p>I have the following structure in my Mongo:</p>
<pre><code>Merchants
 - name
 - _id

Transactions:
 - _id
 - status
 - merchantId
</code></pre>
<p>Every merchant can have multiple transactions. I want to be able to add a field (to the result of aggregate to get all merchants) called <code>hasHolds</code> and set it to true if any of the transactions belonging to a merchant are in the status &quot;capture_pending&quot;.</p>
<p>Here is how I achieved it:</p>
<ol>
<li>Do a <code>$lookup</code> between merchants and transactions as <code>merchantTransactions</code></li>
<li><code>addField</code> &quot;hasHolds&quot; with a <code>cond</code></li>
<li>The <code>cond</code> checks the <code>size</code> of <code>merchantTransactions.status</code> array for each merchant.</li>
<li><code>size</code> runs a <code>filter</code> which only selects an element of the <code>merchantTransactions.status</code> array if its &quot;capture_pending&quot;</li>
</ol>
<p>Thus:
collections:</p>
<pre><code>db={
  &quot;merchants&quot;: [
    {
      &quot;name&quot;: &quot;m1&quot;,
      &quot;_id&quot;: &quot;5b53494987eea4171d199dd3&quot;
    },
    {
      &quot;name&quot;: &quot;m2&quot;,
      &quot;_id&quot;: &quot;5b53495087eea4171d199dd4&quot;
    },
    {
      &quot;name&quot;: &quot;m3&quot;,
      &quot;_id&quot;: &quot;5b53495987eea4171d199dd5&quot;
    }
  ],
  &quot;transactions&quot;: [
    {
      &quot;_id&quot;: &quot;5b53494987eea4171d199dd4&quot;,
      &quot;merchantId&quot;: &quot;5b53494987eea4171d199dd3&quot;,
      &quot;status&quot;: &quot;capture_pending&quot;
