Convert month from number to string question in Mongodb query<p>I am trying to get some avg number per month in the financial year. The collection is called test and the month data comes from <code>CreateDate</code> field. I want to get the avg price per month. The collection data is like below:</p>
<pre><code>{
    &quot;_id&quot; : ObjectId(&quot;5fd289a93f7cf02c36837ca7&quot;),
    &quot;ClientName&quot; : &quot;John&quot;,
    &quot;OrderNumber&quot; : &quot;12345A&quot;,
    &quot;Price&quot; : 10,
    &quot;CreateDate&quot; : ISODate(&quot;2020-09-20T06:00:00.000Z&quot;),
}
{
    &quot;_id&quot; : ObjectId(&quot;5fd289a93f7cf02c36837cc7&quot;),
    &quot;ClientName&quot; : &quot;John&quot;,
    &quot;OrderNumber&quot; : &quot;12345&quot;,
    &quot;Price&quot; : 20,
    &quot;CreateDate&quot; : ISODate(&quot;2020-09-12T06:00:00.000Z&quot;),
}
</code></pre>
<p>So I am writing the query to get the avg number per month by the following within the financial year (from Sep to Aug):</p>
<pre><code>db.test.aggregate([
  {
    $match: {
      &quot;CreateDate&quot;: {
        $lt: ISODate(&quot;2021-08-31T00:00:00.000Z&quot;),
        $gte: ISODate(&quot;2020-09-01T00:00:00.000Z&quot;)
      }
    }
  },
  {
    $group: {
      _id: {$month: &quot;$CreateDate&quot;}, 
      &quot;AvgPrice&quot;: {
        &quot;$avg&quot;: &quot;$Price&quot;,
      } 
    }
  },
  { $project:{ _id : 0 , Month: '$_id' , &quot;AvgPrice &quot;: '$AvgPrice' } } 
])
</code></pre>
<p>The result I am getting is with the following format:</p>
<pre><code>{
    &quot;Month&quot; : 9,
    &quot;AvgPrice &quot; : 15.0
}
{
    &quot;Month&quot; : 10,
    &quot;AvgPrice &quot; : 18.6666666666667
}
</code></pre>
<p>How can I display of the month converting to a string instead of the number. For example, the following is the ideal return:</p>
<pre><code>{
    &quot;Month&quot; : Sep,
    &quot;AvgPrice&quot; : 15.0
}
{
    &quot;Month&quot; : Oct,
    &quot;AvgPrice&quot; : 18.6666666666667
}
</code></pre>
<p>I also have two more questions:</p>
<ol>
<li><p>I am using the Mongodb 3.6 version, is there any way to round up the avg price to two digit after the decimal point? For example, above will be &quot;18.67&quot; instead of &quot;18.66666&quot;.  Mongo 4.2 has something called <code>$round</code> but 3.6 seems doesn't have this function.</p>
</li>
<li><p>If I want to break down by client, has the returning result like below:</p>
</li>
</ol>
<pre><code>{
    &quot;ClientName&quot;: &quot;John&quot;,
    &quot;Month&quot; : Sep,
    &quot;AvgPrice&quot; : 15.0
}
{  
    &quot;ClientName&quot; : &quot;Mary&quot;
    &quot;Month&quot; : Oct,
    &quot;AvgPrice&quot; : 18.6666666666667
}
</code></pre>
<p>How do I put another level of the group to breakdown to the client level and then month level?</p>
<p>Any help will be appreciated!</p>

